$(document).ready(function(){var a=$('[id^="TaskTab"]');$('[id^="ShowTask_"]').hide(0);$("#tab_"+OverrideTab).addClass("tabSelect");$(".tab,.tab1").hover(function(){$(this).addClass("tabHover")},function(){$(this).removeClass("tabHover")}).click(function(){var b=$(this).attr("id");if(b!=="tPrev"&&b!=="tNext"){var c=false;if($(this).hasClass("tab")){c="tab"}else if($(this).hasClass("tab1")){c="tab1"}$("."+c).removeClass("tabSelect");$(this).removeClass("tabHover").addClass("tabSelect")}else{var d=a.index($("#"+$(".tab1.tabSelect").attr("id")));if(b==="tPrev"){if(d==0){return}a.eq(d-1).click()}else{a.eq(d+1).click()}}});$('[id^="Link_TaskTab_"]').hover(function(){$("#TaskTab_"+$(this).attr("id").replace("Link_TaskTab_","")).mouseover()},function(){$("#TaskTab_"+$(this).attr("id").replace("Link_TaskTab_","")).mouseout()}).click(function(){$("#TaskTab_"+$(this).attr("id").replace("Link_TaskTab_","")).click();return false});$(".tab").click(function(){window.location.href="?mode="+$(this).attr("id").replace("tab_","")});$('[id^="TaskTab_"]').click(function(){$('[id^="ShowTask_"]').hide(0);$("#ShowTask_"+$(this).attr("id").replace("TaskTab_","")).show(0)});$(".goCat").click(function(){window.location.href="?"+AddLocationMode+"cat="+$(this).attr("id").replace("cat_","")});$('[id^="skip_"]').click(function(){if(confirm(SkipConfirmText)){window.location.href="?skipcat="+$(this).attr("id").replace("skip_","")}});$(".help").tipTip({delay:0,maxWidth:500,attribute:"title",defaultPosition:"top"});$("#TaskTab_"+SetActiveTask).click()})